Muito *IMPORTANTE*!

- Dia 17/11 - Prefeito Arnaldinho saiu de férias, está publicado no Diário Oficial de Vila Velha;

- Dia 17/11 - a Polícia Civil começa a intimar pessoas e empresas dos Banheiros Públicos que estão na Prainha de Vila Velha;

- Dia 17/11 - Desligaram a Energia dos Postes que estão próximo aos Banheiros Químicos;

- Dia 17/11 - Folha Vitória publica matéria sobre a Vila Natalina que será ABERTA AO PÚLBICO na PRAINHA DE VILA VELHA em *25/11* (https://www.instagram.com/p/ClEYKMxNmCG/)

Tudo encaixando para desmascarar *QUEM* está articulando com *MP* para perseguir os Patriotas que estão acampados na Prainha.

*IMPORTANTE:* a Prainha está dentro de área Militar e não podem paralisar Manifestação Pacífica da população, se usarem a força é preciso que todos saibam como agir.

Se tentarem retirar o acampamento à força observem:

1) vá até a portaria do quartel e procure o Oficial do Dia;
2) peça proteção em área Militar , que seja acionada a *Polícia Militar do Exército*;
3) População precisa permanecer unida.

Compartilhe nos grupos de Whatsapp do *Espírito Santo* -será que o Prefeito de Vila Velha Arnaldinho Borgo vai paralisar uma manifestação Ordeira e Pacífica dos brasileiros patriotas ?
